DROP TABLE IF EXISTS `mageplaza_productslider_slider`;
CREATE TABLE `mageplaza_productslider_slider` (
  `slider_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Rule Id',
  `name` varchar(255) DEFAULT NULL COMMENT 'Name',
