  `shipping_city` varchar(255) DEFAULT NULL COMMENT 'City (Shipping)',
  `shipping_telephone` varchar(255) DEFAULT NULL COMMENT 'Telephone (Shipping)',
  `shipping_country_id` varchar(2) DEFAULT NULL COMMENT 'Country Id (Shipping)',
