  KEY `MAGEWORX_ORDERSGRID_GRID_SHIPPING_CITY` (`shipping_city`),
  KEY `MAGEWORX_ORDERSGRID_GRID_SHIPPING_TELEPHONE` (`shipping_telephone`),
  KEY `MAGEWORX_ORDERSGRID_GRID_SHIPPING_COUNTRY_ID` (`shipping_country_id`),
  KEY `MAGEWORX_ORDERSGRID_GRID_APPLIED_TAX_CODE` (`applied_tax_code`),
  KEY `MAGEWORX_ORDERSGRID_GRID_APPLIED_TAX_PERCENT` (`applied_tax_percent`),
  KEY `MAGEWORX_ORDERSGRID_GRID_APPLIED_TAX_BASE_AMOUNT` (`applied_tax_base_amount`),
  KEY `MAGEWORX_ORDERSGRID_GRID_APPLIED_TAX_BASE_REAL_AMOUNT` (`applied_tax_base_real_amount`),
  KEY `MAGEWORX_ORDERSGRID_GRID_DISCOUNT_AMOUNT` (`discount_amount`),
  FULLTEXT KEY `FTI_178EB852534F0CF58CDDA0E53DC8722C` (`coupon_code`,`product_name`,`product_sku`,`invoices`,`shipments`,`tracking_number`,`billing_fax`,`shipping_fax`),
  CONSTRAINT `MAGEWORX_ORDERSGRID_GRID_ORDER_ID_SALES_ORDER_GRID_ENTITY_ID` FOREIGN KEY (`order_id`) REFERENCES `sales_order_grid` (`entity_id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci COMMENT='MageWorx Extended Orders Grid table';


DROP TABLE IF EXISTS `mageworx_order_base_device_data`;
