  KEY `STRIPE_WEBHOOK_EVENTS_IS_PROCESSED` (`is_processed`),
  KEY `STRIPE_WEBHOOK_EVENTS_RETRIES` (`retries`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci COMMENT='Processed webhook events';


