INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`, `is_magenest`, `magenest_id`) VALUES
(1,	4,	'2022-01-04 03:59:22',	'Disable Notice',	'To improve performance, collecting statistics for the Magento Report module is disabled by default. \nYou can enable it in System Config.',	'',	0,	0,	NULL,	NULL),
(2,	2,	'2022-02-17 16:49:28',	'Security update available for Adobe Commerce | APSB22-12',	'Adobe has released security updates for Adobe Commerce and Magento Open Source. These updates resolve vulnerabilities rated critical. Full details included in security bulletin.',	'https://helpx.adobe.com/security/products/magento/apsb22-12.html',	0,	0,	NULL,	NULL),
(3,	2,	'2022-03-01 23:33:53',	'Magento Open Source 2.4.4 Coming April 12',	'To help ensure this release delivers the highest standards of security and quality, general availability of Magento Open Source is now planned for April 12. For more information, visit our DevBlog. ',	'https://community.magento.com/t5/Magento-DevBlog/Adobe-Commerce-2-4-4-Now-Coming-April-12/ba-p/492935',	0,	0,	NULL,	NULL),
(4,	2,	'2022-04-12 16:52:58',	'Magento Open Source 2.4.4 Available Now!',	'Magento Open Source 2.4.4 enables customers to future-proof and accelerate the growth of their digital commerce businesses. This release is our fastest and most scalable version ever, with increased GraphQL API coverage for several Admin features, as well as new capabilities to PWA Studio 12.3.  Learn how this release can help you save time and maximize resources in our release blog. ',	'https://business.adobe.com/blog/perspectives/future-proof-your-business-with-adobe-commerce-2-4-4',	0,	0,	NULL,	NULL),
(5,	4,	'2022-05-24 15:06:25',	'Prepared to upgrade to Magento Open Source 2.4.4?',	'With 2.3 end of support (EOS) in September and 2.4.0-2.4.3 EOS in November, it is critical to have an upgrade plan in place to make sure your site stays secure, performant and PCI-Compliant. Learn more about how Magento Open Source 2.4.4 will future-proof your business.',	'https://business.adobe.com/blog/perspectives/future-proof-your-business-with-adobe-commerce-2-4-4',	0,	0,	NULL,	NULL),
(6,	4,	'2022-07-26 16:18:18',	'Expanded video library on the Adobe Commerce Experience League',	'Check out our expanded video library on the Adobe Commerce Experience League that now has a set of 35 short demo videos of our core Adobe Commerce capabilities and support tools.',	'https://experienceleague.adobe.com/docs/commerce-learn/tutorials/overview.html?lang=en',	0,	0,	NULL,	NULL),
(7,	1,	'2022-10-11 16:58:58',	'Magento Open Source Security Patches Now Available',	'Adobe is excited to announce that Magento Open Source security-only patches 2.4.5-p1 and 2.4.4-p2 are now available to our entire Commerce Community. In this release, you will find several security enhancements. Refer to the Readying your business for peak season shopping blog for more information and other exciting upgrades. ',	'https://business.adobe.com/blog/the-latest/readying-your-business-for-peak-season-shopping',	0,	0,	NULL,	NULL),
(8,	4,	'2023-01-17 00:00:00',	'New extension!',	'Announcing Affiliate Pro, the extension designed to help you start and manage an affiliate program.',	'https://www.mageworx.com/magento-2-affiliate-extension.html?utm_source=backend&amp;utm_medium=notification&amp;utm_campaign=affiliate_pro',	0,	0,	NULL,	NULL),
(9,	1,	'2023-03-14 16:47:30',	'Welcome Magento Open Source 2.4.6, along with exciting product updates',	'We are excited to announce that our March release, including Magento Open Source 2.4.6, is now available to our entire Commerce Community. In this core release, you will find several enhancements to platform quality, security, performance, and scale. Also included in this release is the expansion of Payment Services to UK and France. Refer to the Adobe release blog. ',	'https://business.adobe.com/blog/the-latest/7-adobe-commerce-innovations-that-increase-sales-and-performance',	0,	0,	NULL,	NULL),
(10,	1,	'2023-06-13 14:28:45',	'Magento Open Source June release brings important accessibility and security updates',	'We are excited to announce great new accessibility updates in PWA Studio, along with multiple security updates in our June release. PWA Studio can now address the needs of people with all types, degrees, and combinations of disability. These guidelines make Web content more usable for individuals with changing abilities due to aging and often improve usability for users in general. We also have new security patches for all versions still under support or extended support. ',	'https://business.adobe.com/blog/the-latest/three-rules-of-b2b-commerce-using-adobe-commerce',	0,	0,	NULL,	NULL);
